  {
   "cell_type": "markdown",
   "id": "84ff7e1d",
   "metadata": {},
   "source": [
    "Good job! Seaborn's API makes it very simple to create multiple abstract representations of categorical data.\n",
    "\n",
    "## barplots, pointplots and countplots\n",
    "The final group of categorical plots are barplots, pointplots and countplot which create statistical summaries of the data. The plots follow a similar API as the other plots and allow further customization for the specific problem at hand.\n",
    "\n",
    "* Create a countplot with the df dataframe and Model Selected on the y axis and the color varying by Region."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 8,
   "id": "9f745f60",
   "metadata": {},
   "outputs": [
    {
     "data": {
      "image/png": "\n",
      "text/plain": [
       "<Figure size 432x288 with 1 Axes>"
      ]
     },
     "metadata": {
      "needs_background": "light"
     },
     "output_type": "display_data"
    },
    {
     "data": {
      "text/plain": [
       "<Figure size 432x288 with 0 Axes>"
      ]
     },
     "metadata": {},
     "output_type": "display_data"
    }
   ],
   "source": [
    "# Show a countplot with the number of models used with each region a different color\n",
    "sns.countplot(data=df,\n",
    "              y=\"Model Selected\",\n",
    "              hue=\"Region\")\n",
    "\n",
    "plt.show()\n",
    "plt.clf()"
   ]
  },
