  {
   "cell_type": "markdown",
   "id": "cae93df7",
   "metadata": {},
   "source": [
    "The pointplot and barplot can be useful visualizations for understanding the variations of categorical data.\n",
    "\n",
    "## Regression and residual plots\n",
    "Linear regression is a useful tool for understanding the relationship between numerical variables. Seaborn has simple but powerful tools for examining these relationships.\n",
    "\n",
    "For these exercises, we will look at some details from the US Department of Education on 4 year college tuition information and see if there are any interesting insights into which variables might help predict tuition costs.\n",
    "\n",
    "* Plot a `regression plot` comparing Tuition and average SAT scores(SAT_AVG_ALL).\n",
    "* Make sure the values are shown as green triangles."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 13,
   "id": "2aef53b3",
   "metadata": {},
   "outputs": [
    {
     "data": {
      "image/png": "\n",
      "text/plain": [
       "<Figure size 432x288 with 1 Axes>"
      ]
     },
     "metadata": {
      "needs_background": "light"
     },
     "output_type": "display_data"
    },
    {
     "data": {
      "text/plain": [
       "<Figure size 432x288 with 0 Axes>"
      ]
     },
     "metadata": {},
     "output_type": "display_data"
    }
   ],
   "source": [
    "df = pd.read_csv('datasets/College Scorecard Tuition.csv')\n",
    "\n",
    "# Display a regression plot for Tuition\n",
    "sns.regplot(data=df,\n",
    "            y='Tuition',\n",
    "            x='SAT_AVG_ALL',\n",
    "            marker='^',\n",
    "            color='g')\n",
    "\n",
    "plt.show()\n",
    "plt.clf()"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "de43354f",
   "metadata": {},
   "source": [
    "* Use a residual plot to determine if the relationship looks linear."
   ]
  },
